l overspread the region between 1\\nand 4 am Friday morning. The snow will quickly become heavy\\nfalling at the rate of 1 to 2 inches per hour at times through\\ndaybreak Friday. The snow will change to sleet from south to\\nnorth Friday morning and some light freezing rain is possible\\nacross northern Connecticut and northwest Rhode Island.\\nPrecipitation may change to a period of plain rain across far\\nsoutheast New England. Mixed precipitation will change back to\\nall snow before ending later Friday afternoon and early evening.\\nThis will result in a flash freeze across portions of Rhode\\nIsland and Southeast Massachusetts.\",\"tags\":[\"Wind\"]},{\"sender_name\":\"NWS Boston (Southeast New England)\",\"event\":\"Winter Storm Warning\",\"start\":1645804680,\"end\":1645851600,\"description\":\"...WINTER STORM WARNING REMAINS IN EFFECT UNTIL MIDNIGHT EST\\nTONIGHT...\\n* WHAT...Snow and sleet with a bit of light freezing drizzle\\npossible across northwest Rhode Island and northern Connecticut\\nthis afternoon as well. Snow accumulations of 4 to 7 inches and\\nice accumulations of a light glaze of ice in some spots.\\n* WHERE...Portions of northern Connecticut, southeastern\\nMassachusetts and northern Rhode Island.\\n* WHEN...Until midnight EST tonight.\\n* IMPACTS...Travel will be very difficult this morning and early\\nafternoon.\\n* ADDITIONAL DETAILS...Improving conditions this afternoon\\nespecially along the coast as temps rise above freezing and\\nprecipitation becomes rather light. A second round of mainly\\nlight snow may result in renewed slippery travel late this\\nafternoon and evening with the focus across southeast\\nMassachusetts and Rhode Island. A flash freeze is also\\nexpected late this afternoon and early this evening along the\\ncoast as above freezing temperatures fall back into the 20s.\",\"tags\":[\"Wind\"]}],\"moonPhase\":0.875}"
